import React from 'react';
import Dialog from '@material-ui/core/Dialog';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import PropTypes from 'prop-types';
import ImageGallery from 'react-image-gallery';
import Grid from '@material-ui/core/Grid';
import "react-image-gallery/styles/css/image-gallery.css";
import Button from '@material-ui/core/Button';
import InstagramProfilePhone from '../../assets/instagramProfileMobile.png';

const images =(pictures) => {
  if(pictures){
    return pictures.map( picture => {
      return {
        original: picture.url,
        thumbnail: picture.url
      }
    })
  }
}

const styles = {
  showCaseContentLeft:{
  },
  showCaseContentRight:{
  },
};

const ProjectDialog = ({
  showDialog,
  closeDialog,
  project,
  scroll
}) => {
  console.log(project.pictures)
  return (
      <div>
        <Dialog
          open={showDialog}
          onClose={closeDialog}
          scroll={scroll}
          maxWidth={'lg'}
          aria-labelledby="scroll-dialog-title"
        >
          <DialogTitle id="scroll-dialog-title">{project.title}</DialogTitle>
          <DialogContent>
          <Grid container spacing ={0} style={styles.showcaseContent}>
              <Grid item xs={12} sm={6} style={styles.showCaseContentLeft}>
              <ImageGallery items={images(project.pictures)} />
              </Grid>
              <Grid item xs={12} sm={6} style={styles.showCaseContentRight}>

              </Grid>
            </Grid>
            <DialogContentText>
              {project.description}
            </DialogContentText>
          </DialogContent>
        </Dialog>
      </div>
  );
};

export default ProjectDialog;

ProjectDialog.propTypes = {
  project: PropTypes.object.isRequired,
  showDialog: PropTypes.bool.isRequired,
  closeDialog: PropTypes.func.isRequired,
  scroll: PropTypes.string.isRequired
};

ProjectDialog.defaultProps = {
  scroll: 'body'
};
